%---- plotting 
% Angles
figure; hold on
plot(time,motor1,'r','linewidth',2);    % base motor
plot(time,motor2,'k','linewidth',2);    % second motor
plot(time,motor3,'b','linewidth',2);    % third motor
%legend('RotaryMotor1(\theta_1)','RotaryMotor2(\theta_2)','RotaryMotor3(\theta_3)','setbestposition');   
legend('\theta_1','\theta_2','\theta_3','setbestposition');   
xlabel('time [seconds]','fontsize',12);ylabel('\theta [degrees]','fontsize',12)
grid on

% efector position
figure;hold on
plot(time,xpos,'r','linewidth',2);
plot(time,ypos,'g','linewidth',2);
plot(time,zpos,'m','linewidth',2);
legend('x-pos','y-pos','z-pos') 
xlabel('time [seconds]','fontsize',12);ylabel('Position [mm]','fontsize',12)
grid on

% efector directions
figure, hold on
plot(time,phi,'k','linewidth',1.5);
plot(time,psi,'b','linewidth',1.5);
plot(time,theta,'m','linewidth',1.5);
legend('\phi','\psi','\theta')
xlabel('time [seconds]','fontsize',12);ylabel('Angle [degrees]','fontsize',12)
grid on
end
